import { Component } from "react";
import "./mainLogin.css";
import { Link } from 'react-router-dom';
import {Button, Form} from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import Header from '../commons/Header/Header';
import Footer from '../commons/Footer/Footer';

class MainLoginPage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      email: '',
      password: "",
    }

    this.submitHandler = this.submitHandler.bind(this);
  }

  submitHandler (e) {
    e.preventDefault();

    console.log(e.this.state.email.value)
  }

  render() {
    let {email, password} = this.state;
    return (

      <div className="login-form">
        <Header />
        <Form onSubmit={this.submitHandler} style={{
        width: '20rem',
        margin: '0 auto',
        marginTop: '100px',
        padding: '40px 25px 40px 25px',
       backgroundColor: "#222",
      }}>
        <Form.Group controlId="formBasicEmail">
          <Form.Label>Email address:</Form.Label>
          <Form.Control type="email" placeholder="email@email.com" name="email" value="email" />
          <Form.Text className="text-muted">
            We'll never share your email with anyone else.
          </Form.Text>
        </Form.Group>

        <Form.Group controlId="formBasicPassword">
          <Form.Label>Password:</Form.Label>
          <Form.Control type="password" placeholder="Password" name="password" value={password} />
        </Form.Group>
        <Button variant="primary" type="submit">
          Login
        </Button>
        <Link className ="regClass" to="/login-register/MainRegisterPage">
           / Register
        </Link>
      </Form>
      <Footer />
      </div>

   );
  }
}

export default MainLoginPage;
